(window.webpackJsonp=window.webpackJsonp||[]).push([[258],{613:function(n,h,t){"use strict";t.r(h);var c=t(44),i=Object(c.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1209-đi-te-bac-đam-lay"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1209-đi-te-bac-đam-lay"}},[n._v("#")]),n._v(" Chương 1209: Đi Tề Bắc đầm lầy")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1209: Đi Tề Bắc đầm lầy"),t("br"),t("br"),n._v("Thân là thất tinh danh sư, Lạc Thất Thất cùng Ngọc Phi Nhi ý nghĩ, Trương Huyền tự nhiên có thể nhìn ra, có điều, có ưa thích người, đối với cái khác tình cảm, không nghĩ tới nhiều chạm phải, cho dù thời gian ngắn để hắn đau lòng, nhưng cũng so một mực nhường một chút hắn đau lòng tốt hơn nhiều."),t("br"),t("br"),n._v("Đau dài không bằng đau ngắn, tình cảm bên trên không thể có do dự chút nào cùng chần chừ, nếu không, hại người hại mình."),t("br"),t("br"),n._v("Đưa mắt nhìn Ngọc Phi Nhi rời khỏi, đem trong lòng tao loạn bình tĩnh trở lại, Trương Huyền lúc này mới tìm tới Hình đường chủ."),t("br"),t("br"),n._v("Hiện tại trọng yếu nhất chính là giải quyết Tề Bắc đầm lầy Ngoan Nhân vấn đề, nếu không, tùy ý cái tên này làm hại, không riêng gì Danh Sư đường danh sư, chính mình cũng không an toàn."),t("br"),t("br"),n._v("Dù sao, trời nhận danh sư đối Dị Linh tộc nhân lực hấp dẫn là tại quá lớn, cho dù hắn bị nhốt, không cách nào động thủ, nhưng chỉ cần đem tin tức truyền đi, sau này mình thời gian cũng không dễ chịu, tất nhiên sẽ nghênh đón vô cùng vô tận đuổi giết."),t("br"),t("br"),n._v("“Nguy hiểm cho Danh Sư đường, chúng ta thân là một thành viên trong đó, chắc chắn sẽ không ngồi yên không lý đến! Trương sư, còn xin dẫn ta cùng một chỗ!”"),t("br"),t("br"),n._v("Nghe xong chuyện này, Hình đường chủ ánh mắt kiên định."),t("br"),t("br"),n._v("Chiến Sư đường, thuộc về Danh Sư đường một bộ phận, một cái Dị Linh tộc nhân, thế mà xuống tay với hắn, thân là đường chủ, việc nghĩa chẳng từ."),t("br"),t("br"),n._v("“Tốt, ngươi tuyển hai người cùng ta cùng một chỗ là được, không cần quá nhiều, nếu không rất dễ dàng gây nên chú ý, một khi đối phương trước thời hạn làm ra chuẩn bị, lại nghĩ đem hắn chém giết, liền khó khăn!”"),t("br"),t("br"),n._v("Dừng lại một chút, Trương Huyền nói."),t("br"),t("br"),n._v("Ngoan Nhân thế nhưng là đã từng cùng Khổng sư chiến đấu siêu cường tồn tại, tin tức rò rỉ, đối phương có chút chuẩn bị, đừng nói giết chết, khả năng làm không cẩn thận đều sẽ vẫn lạc."),t("br"),t("br"),n._v("“Ta biết!”"),t("br"),t("br"),n._v("Rõ ràng mức độ nghiêm trọng của sự việc, Hình đường chủ nhẹ gật đầu, vội vã mà đi."),t("br"),t("br"),n._v("Thời gian không dài, Hồn điện Liêu điện chủ, cùng Nội Tức điện Ngụy điện chủ theo ở phía sau đi tới trước mặt."),t("br"),t("br"),n._v("“Bọn họ sớm nhất bắt đầu tu luyện Lưu Ly Luyện Tâm kinh, tâm cảnh vững chắc nhất, nếu như đối phương thật sự là am hiểu công kích linh hồn vu hồn sư, hai người bọn họ thích hợp nhất!” Hình đường chủ nói."),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("Vu hồn sư am hiểu công kích linh hồn, làm ra đủ loại huyễn cảnh, tâm cảnh cao, sẽ an toàn không ít."),t("br"),t("br"),n._v("Liêu điện chủ làm Tâm điện điện chủ, không thể nghi ngờ, Ngụy điện chủ là sớm nhất tiếp xúc Lưu Ly Luyện Tâm kinh, tu luyện một đoạn thời gian, tất nhiên cũng có cực lớn tiến bộ, lại thêm hai người này thực lực, gần với Hình đường chủ, bọn họ ra tay, quả thực là thí sinh tốt nhất."),t("br"),t("br"),n._v("“Lần này đi, cửu tử nhất sinh, vô cùng có khả năng lại về không được, các ngươi cần nghĩ kĩ!”"),t("br"),t("br"),n._v("Trương Huyền vẻ mặt nghiêm túc nhìn qua."),t("br"),t("br"),n._v("“Chúng ta biết!”"),t("br"),t("br"),n._v("“Tổ kiến Chiến Sư đường dụng ý, liền là giải quyết tai hoạ ngầm, xông pha chiến đấu, có thể vì nhân tộc mà chết, có chết cũng vinh dự!”"),t("br"),t("br"),n._v("Ngụy điện chủ, Liêu điện chủ không có chút nào do dự."),t("br"),t("br"),n._v("“Vậy thì tốt, hiện tại đi Danh Sư đường, cùng Ngô sư đám người tụ hợp!”"),t("br"),t("br"),n._v("Thấy bọn họ thái độ kiên định, biết đây là Chiến Sư đường nhiều năm qua bồi dưỡng ra được tinh thần, Trương Huyền không nói thêm lời, đi đầu hướng Danh Sư đường bay đi."),t("br"),t("br"),n._v("Ngô sư lúc này, cũng tìm xong nhân thủ, ba vị trung thành tuyệt đối thất tinh đỉnh phong cấp bậc trưởng lão, còn có một vị, lại là người quen biết cũ... Trương Cửu Tiêu."),t("br"),t("br"),n._v("“Cửu Tiêu đi qua Tề Bắc đầm lầy, hơn nữa tự mình từng tiến vào hố ma, ta cảm thấy, Thanh Điền Hoàng lão sư ẩn thân chỗ, vô cùng có khả năng cùng nơi này liên quan đến, để hắn dẫn đường, tương đối phù hợp!” Ngô sư nói."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Sửng sốt một chút, Trương Huyền gật đầu."),t("br"),t("br"),n._v("Thanh Điền Hoàng ký ức bên trong, tin tức liên quan tới Ngoan Nhân, cũng không nhiều, cũng không tỉ mỉ, cũng không phải hắn sưu hồn năng lực không đủ, mà là Ngoan Nhân đã tinh thông Vu hồn, tự nhiên biết làm sao loại bỏ ký ức, tránh khỏi nguy hiểm phát sinh."),t("br"),t("br"),n._v("Cho nên, Thanh Điền Hoàng trong đầu ký ức trên thực tế cũng không hoàn chỉnh!"),t("br"),t("br"),n._v("Vị này Trương Cửu Tiêu đã đi qua hố ma, để hắn dẫn đường, tất nhiên có thể miễn đi không ít phiền phức."),t("br"),t("br"),n._v("“Trương sư, chúng ta cho dù có mâu thuẫn, ta đối với ngươi cũng có chút không chịu... Nhưng dính dáng nhân tộc, ta sẽ không lùi bước, bởi vì... Ta là danh sư!” Trương Cửu Tiêu nhìn qua, biểu lộ kiên định."),t("br"),t("br"),n._v("“Đúng vậy a, chúng ta đều là danh sư...”"),t("br"),t("br"),n._v("Không nghĩ tới hắn lại có loại ý nghĩ này, Trương Huyền có chút ngoài ý muốn."),t("br"),t("br"),n._v("Trước đó bởi vì Lạc Nhược Hi sự tình, cảm thấy Trương gia, là cái loại này không để ý người khác cảm thụ, dựa dẫm lực lượng, bá đạo đến cực điểm, không nói đạo lý gia tộc, lúc này thấy Trương Cửu Tiêu thái độ như thế, ý nghĩ trong lòng, nhịn không được có chút đổi mới."),t("br"),t("br"),n._v("Đang tại cảm khái, chỉ thấy thanh niên trước mắt, lông mi nâng lên, mang theo không được dao động vẻ mặt: “Hơn nữa, ta còn muốn vượt qua ngươi... Để ngươi biết, ta Trương Cửu Tiêu, mới thật sự là thiên tài!”"),t("br"),t("br"),n._v("“Vượt qua ta?”"),t("br"),t("br"),n._v("Không nghĩ tới hắn ôm loại ý nghĩ này, Trương Huyền lắc đầu, dở khóc dở cười: “Ngươi vui vẻ là được rồi...”"),t("br"),t("br"),n._v("Vượt qua bản thân?"),t("br"),t("br"),n._v("Có lẽ trên đời này sẽ có thiên tài, mạnh hơn mình, nhưng... Tuyệt không phải trước mắt vị này."),t("br"),t("br"),n._v("Hắn bất kể tâm cảnh, thực lực, phụ tu... Được rồi, không muốn, tưởng tượng đều là rãnh điểm, nghĩ vượt qua bản thân, loại chuyện tốt này... Cũng chỉ có thể suy nghĩ một chút, làm không cẩn thận sẽ bị tiến công càng ngày càng lợi hại, cuối cùng đánh mất lòng tin."),t("br"),t("br"),n._v("“Đã người đã đông đủ, chúng ta lên đường đi!”"),t("br"),t("br"),n._v("Nhân viên xác định, không do dự nữa, Ngô sư tìm đến Danh Sư đường cấp bậc cao nhất phi hành Thánh thú, mọi người tiến vào bên trong, nhanh chóng hướng Tề Bắc đầm lầy phương hướng bay đi."),t("br"),n._v("Tề Bắc đầm lầy, tại Tề Bắc thành phía bắc, khoảng cách Thanh Nguyên Đế đô, chừng trăm vạn cây số, Danh Sư đường phi hành Thánh thú, cho dù đạt đến Nguyên Thần cảnh đỉnh phong, muốn bay qua, cũng cần ít nhất năm, sáu ngày."),t("br"),t("br"),n._v("“Ta cái này có chút đan dược, là trước khi đến chuyên môn luyện chế, đến lúc đó, tất cả mọi người ăn vào, có thể hiểu bách độc, còn có thể dự phòng vu hồn sư đoạt xá...”"),t("br"),t("br"),n._v("Đứng tại Thánh thú sống lưng trong nhà gỗ, Trương Huyền lấy ra mấy cái đan dược đưa tới."),t("br"),t("br"),n._v("Lần này đi Tề Bắc đầm lầy, cộng thêm hắn tổng cộng chín người, cho dù từng cái đều là Thanh Nguyên thành đỉnh phong nhất tồn tại, nhưng đối phó với Ngoan Nhân này loại sống không biết bao lâu lão quái vật, còn là cần sớm chuẩn bị."),t("br"),t("br"),n._v("“Vâng!”"),t("br"),t("br"),n._v("Mọi người nhận lấy đan dược, cẩn thận cất kỹ."),t("br"),t("br"),n._v("“Chiến Sư đường hợp kích trận pháp không sai, nhân số bao nhiêu, có thể tùy ý tổ hợp, vẫn như trước có không ít thiếu hụt, ta vừa mới cải tiến một chút, cũng đem phối hợp phương pháp ghi lại ở phía trên, các ngươi truyền đọc một cái, thừa dịp hiện tại học tập...”"),t("br"),t("br"),n._v("Lần nữa lấy ra một quyển sách, Trương Huyền đưa tới."),t("br"),t("br"),n._v("Chiến Sư đường cùng Danh Sư đường đều có hợp kích trận pháp, nói với người khác tới, loại trận pháp này, xem như cực kỳ lợi hại, nhưng đối với hắn mà nói, sơ hở tầng tầng, thực sự nhìn không được, vừa rồi phi hành công phu, cải tiến một phen."),t("br"),t("br"),n._v("“Cải tiến Chiến Sư đường trận pháp?”"),t("br"),t("br"),n._v("Hình đường chủ cùng Liêu điện chủ đám người nhìn lại, chỉ chốc lát, từng cái vẻ mặt thấu đỏ, hô hấp dồn dập."),t("br"),t("br"),n._v("Vốn cho rằng, bọn họ Chiến Sư đường trận pháp, đi qua nhiều năm rèn luyện, đã đạt tới lại không cách nào sửa chữa tình trạng, nằm mơ đều không có nghĩ đến, cùng Trương sư sửa đổi trận pháp so sánh, kém không biết bao nhiêu một đoạn."),t("br"),t("br"),n._v("Rất nhanh, đem trận pháp truyền đọc một lần."),t("br"),t("br"),n._v("Xem hết cải biến qua trận pháp, Trương Cửu Tiêu cũng sắc mặt lúc đỏ lúc trắng, qua không biết bao lâu, lắc đầu."),t("br"),t("br"),n._v("Trận pháp nhất đạo bên trên, khẳng định là không sánh bằng trước mắt vị này... Chỉ có thể nhìn một chút có thể hay không tại cái khác chỗ vượt qua."),t("br"),t("br"),n._v("“Dù là lợi hại hơn nữa thiên tài, đều sẽ có thiếu hụt... Hắn khẳng định cũng có, chỉ cần ở chung lâu, tất nhiên có thể tìm tới...”"),t("br"),t("br"),n._v("Đem buồn bực trong lòng áp chế xuống, Trương Cửu Tiêu thở phào nhẹ nhõm, đang định bắt đầu học tập trận pháp, chỉ thấy Trương Huyền nhìn lại: “Trương huynh, ngươi là Trương gia người, ta vừa vặn muốn hỏi ngươi một việc...”"),t("br"),t("br"),n._v("“Trương sư mời nói!”"),t("br"),t("br"),n._v("“Là như vậy, ta nghe nói, các ngươi Trương gia, có một cái tuyệt thế thiên tài, huyết mạch mười phần tinh thuần... Không biết có phải hay không thật?” Dừng lại một chút, Trương Huyền nhịn không được hỏi."),t("br"),t("br"),n._v("Biết người biết ta, bách chiến bách thắng."),t("br"),t("br"),n._v("Đã vị này là Trương gia người, đánh trước nghe một cái vị này Trương gia thiên tài lại nói, cũng có thể sớm chuẩn bị."),t("br"),t("br"),n._v("“Ta tại Trương gia, thuộc về bàng chi, có tối đa nhất tư cách tiến vào chi nhánh gia phả, hạch tâm phủ đệ, không có tư cách đi qua. Ngươi nói là vị kia tiểu thiếu gia đi, ta nghe nói qua, năm nay hai mươi tuổi... Thiên phú vô song, cho dù không phải đương thời đệ nhất, cũng chênh lệch không xa...”"),t("br"),t("br"),n._v("Chần chờ một chút, Trương Cửu Tiêu nói: “Bất quá, chưa bao giờ thấy qua.”"),t("br"),t("br"),n._v("Trương gia tiểu thiếu gia chuyện này, ra đời thời điểm, huyên náo động tĩnh rất lớn, cũng không phải bí mật gì, nói ra cũng không tính là gì."),t("br"),t("br"),n._v("“Ngươi đều chưa thấy qua?”"),t("br"),t("br"),n._v("“Đúng vậy a, hạch tâm con cháu, chúng ta loại này bàng chi thấy rất ít...” Trương Cửu Tiêu gật đầu."),t("br"),t("br"),n._v("“Ta nghe nói... Các ngươi vị tiểu thiếu gia này cùng Lạc gia tiểu công chúa, có hôn ước, không biết có phải hay không thật?” Trương Huyền hỏi tiếp."),t("br"),t("br"),n._v("“Cái này... Ta cũng không rõ ràng! Hạch tâm cơ mật, gia tộc không cho phép chúng ta hỏi, cũng không cho phép nói lung tung!” Dường như có chút kiêng kị, Trương Cửu Tiêu cũng không muốn tại đây đề tài bên trên vướng víu."),t("br"),t("br"),n._v("“Ừm, vậy ngươi đã gặp hạch tâm con cháu, so với ngươi, thiên phú làm sao?” Trương Huyền tiếp tục nói."),t("br"),t("br"),n._v("“Ta? Chúng ta là sâu kiến cùng Thần Long chênh lệch, không thể so sánh so sánh!”"),t("br"),t("br"),n._v("Cười khổ một tiếng, Trương Cửu Tiêu nhìn qua: “Không nói cái khác, Trương sư thiên phú của ngươi, xem như cực cao, nhìn chung Thanh Nguyên lịch Đế quốc sử, có thể vượt qua, khả năng cũng không nhất định có... Nhưng cùng những hạch tâm đó con cháu so, còn là kém quá nhiều!”"),t("br"),t("br"),n._v("“Ta đều kém rất xa?” Lông mày nhíu một cái, Trương Huyền khó tin."),t("br"),t("br"),n._v("Hắn tu luyện Thiên Đạo công pháp, mặc dù không nói tiến bộ rất nhanh, nhưng cũng không chậm, chẳng lẽ còn có người so với chính mình càng thêm thiên tài?"),t("br"),t("br"),n._v("“Đúng vậy a, Trương sư không cần không tin! Lợi hại hạch tâm con cháu, chỉ cần kích hoạt huyết mạch, cho dù trước đó không tu luyện, đều có thể nhẹ nhõm đạt tới Nguyên Thần cảnh, trực tiếp trùng kích xuất khiếu, thậm chí cao hơn! Không phải chúng ta loại thực lực này có thể đi nghĩ tới!”"),t("br"),t("br"),n._v("Trương Cửu Tiêu mặt mũi cười khổ."),t("br"),t("br"),n._v("Thiên phú thứ này, không có cách nào so sánh."),t("br"),t("br"),n._v("Thật giống như Dị Linh tộc nhân, vừa ra đời liền nắm giữ Hóa Phàm cảnh thực lực đồng dạng, rất nhiều hạch tâm con cháu, chỉ cần kích hoạt huyết mạch, trực tiếp có thể đạt tới cảnh giới cực cao, người bình thường căn bản không có cách nào bằng được."),t("br"),t("br"),n._v("“Kích hoạt huyết mạch? Thánh Nhân quý tộc đời sau, huyết mạch càng tinh khiết hơn, kích hoạt thời điểm, tiến bộ càng lớn?”"),t("br"),t("br"),n._v("“Đúng vậy a, cái này cùng một chút linh thú có chút tương tự, huyết mạch càng tiếp cận cổ thú, thực lực cũng sẽ tiến bộ càng lớn! Đây cũng là Thánh Nhân quý tộc sừng sững vài vạn năm đều mạnh mẽ vô cùng nguyên nhân chủ yếu!” Trương Cửu Tiêu gật đầu."),t("br"),t("br"),n._v("“Nói như vậy, huyết mạch của ngươi cũng không tinh thuần?”"),t("br"),t("br"),n._v("“Ta chỉ là bàng chi bên trong bàng chi, huyết mạch cảnh xuân đều, tự nhiên xa xa không bằng...” Trương Cửu Tiêu tràn đầy xấu hổ."),t("br"),t("br"),n._v("“Đã huyết mạch trọng yếu như vậy... Có hay không phương pháp, chiết xuất huyết mạch, hoặc là... Để huyết mạch đẳng cấp tăng thêm?”"),t("br"),t("br"),n._v("Trương Huyền nhịn không được nói."),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1217"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1219"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);